import React, { useState } from 'react';
import { NavigationContainer } from '@react-navigation/native';
import { createNativeStackNavigator } from '@react-navigation/native-stack';
import Statistics from './screens/Statistics';
import Game from './screens/Game';
import ResultModal from './screens/ResultModal';

export default function App() {
  const RootStack = createNativeStackNavigator();
  function MainStackScreen() {
    return (
      <NavigationContainer>
        <RootStack.Group>
          <RootStack.Screen name='Game Screen' component={Game} />
          <RootStack.Screen name='Statics Screen' component={Statistics} />
        </RootStack.Group>
      </NavigationContainer>
    );
  }
  return (
    <NavigationContainer>
      <Stack.Navigator initialRouteName='Game Screen'>
        <Stack.Group screenOptions={{ presentation: 'modal' }}>
          <Stack.Screen name='Result Modal' component={ResultModal} />
        </Stack.Group>
      </Stack.Navigator>
    </NavigationContainer>
  );
}

const Stack = createNativeStackNavigator();
